import React from "react";
import { ReactDOM } from "react";

export const Title = () => (
    <a href='/'>
      <h1>Food Villa</h1>
    </a>
  );

  const HeaderComponent = () => {
    return(
      <div className='header'>
        <Title/>
        <div className='navitems'>
          <ul>
            <li>Home</li>
            <li>About</li>
            <li>Contact Us</li>
            <li>Cart</li>
          </ul>
        </div>
      </div>
    );
  };

  export default HeaderComponent;
